                setChampionId = {this.props.setChampionId}
                history = {this.props.history}
              />
              :
              <MatchContainer showMatches={this.props.showMatches} matches={this.props.matches} displayMatches={this.props.displayMatches}/>
            }
          </div>
        </div>
      </div>
    )
  }
}
